// Product.js

import React from 'react';

const ProductPage = ({ product }) => {
    return (
        <div className="product">
            <h3>{product.name}</h3>
            <p>Price: ${product.price}</p>
            <p>Description: {product.description}</p>
        </div>
    );
};

export default ProductPage;
